class App extends React.Component {
  constructor () {
    super()
    this.state = {
      isLoggetIn: false
    }
  } 
  render () {
    let result;
    if(this.state.isLoggetIn === true) {
      result = "in"
    } else {
      result = "out"
    }
    return ( 
        <div> 
            <h1>You are currently logged {result}</h1> 
        </div> 
    ) 
  }
}
   
export default App
